import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (
      <div className='background'>
        <nav className='align'>    
        <u >  
            <h3>Train Route Management</h3><br></br>
      <NavLink to="/routes">  <button><b> Route Details</b></button></NavLink>  
         <NavLink to="/trains"><button><b>Train Details </b></button></NavLink>
        <NavLink to="/station"><button><b>Intermediate Stations </b></button></NavLink>
          <NavLink to="/timeschedule"><button><b>Train Schedule</b></button></NavLink>
          </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
